const AppName =()=>{
    return(
        <>
   
   <Movie />
   <Movie />
   <Movie />
   <Movie />
   <Movie/>

    </>
);
};
const Movie =()=> {

    return(
    <article>
        <ImageComponent/>
        <Title/>
    </article>
    );

};
const ImageComponent  = () =>{
    return ( 
    <img src="logo192.png " alt=" sage it company logo"/>
    );
};
const Title =() =>{
    const style={
         heading:{
            colour:"red",
            fontSize:"30px"
        },
        smallheading:{
            colour:"yellow",
            fontsize:"10px"
        }

    };
    return(
    <h1 style={style.heading}> above image-is-react<br/>
    <span style={style.smallheading}>this is sage it creations</span>
    </h1>
);
}; 
    
export default AppName;
